// LoadNoteImage loads the noteImageBreadcrumb's NoteImage into the .R struct
func (o *NoteImageBreadcrumb) LoadNoteImage(ctx context.Context, exec bob.Executor, mods ...bob.Mod[*dialect.SelectQuery]) error {
	if o == nil {
		return nil
	}

	// Reset the relationship
	o.R.NoteImage = nil

	related, err := o.NoteImage(mods...).One(ctx, exec)
	if err != nil {
		return err
	}

	related.R.NoteImageBreadcrumbs = NoteImageBreadcrumbSlice{o}

	o.R.NoteImage = related
	return nil
}

// LoadNoteImage loads the noteImageBreadcrumb's NoteImage into the .R struct
func (os NoteImageBreadcrumbSlice) LoadNoteImage(ctx context.Context, exec bob.Executor, mods ...bob.Mod[*dialect.SelectQuery]) error {
	if len(os) == 0 {
		return nil
	}

	noteImages, err := os.NoteImage(mods...).All(ctx, exec)
	if err != nil {
		return err
	}

	for _, o := range os {
		if o == nil {
			continue
		}

		for _, rel := range noteImages {

			if !(o.NoteImageVersion == rel.Version) {
				continue
			}

			if !(o.NoteImageUUID == rel.UUID) {
				continue
			}

			rel.R.NoteImageBreadcrumbs = append(rel.R.NoteImageBreadcrumbs, o)

			o.R.NoteImage = rel
			break
		}
	}

	return nil
}

type noteImageBreadcrumbJoins[Q dialect.Joinable] struct {
	typ       string
	NoteImage modAs[Q, noteImageColumns]
}

func (j noteImageBreadcrumbJoins[Q]) aliasedAs(alias string) noteImageBreadcrumbJoins[Q] {
	return buildNoteImageBreadcrumbJoins[Q](buildNoteImageBreadcrumbColumns(alias), j.typ)
}

func buildNoteImageBreadcrumbJoins[Q dialect.Joinable](cols noteImageBreadcrumbColumns, typ string) noteImageBreadcrumbJoins[Q] {
	return noteImageBreadcrumbJoins[Q]{
		typ: typ,
		NoteImage: modAs[Q, noteImageColumns]{
			c: NoteImages.Columns,
			f: func(to noteImageColumns) bob.Mod[Q] {
				mods := make(mods.QueryMods[Q], 0, 1)

				{
					mods = append(mods, dialect.Join[Q](typ, NoteImages.Name().As(to.Alias())).On(
						to.Version.EQ(cols.NoteImageVersion), to.UUID.EQ(cols.NoteImageUUID),
					))
				}

				return mods
			},
		},
	}
}
